&quot;Ek Paheli Leela&quot; is an upcoming 2015 Bollywood Musical thriller film, written &amp; directed by Bobby Khan and produced by Bhushan Kumar and Krishan Kumar. It stars Sunny Leone in the titular lead role with Jay Bhanushali, Rajneesh Duggal, Jas Arora, Mohit Ahlawat and Rahul Dev in pivotal roles. Choreography is done by Saroj Khan and Ahmed Khan. Music for the film is composed by Amaal Mallik. The film will release on 10 April 2015


